import React from "react";
import "./page2.css";
function Page2(){
    return(
        <div class="pg2">
            <div class="row">
            <div class="column">
            <img src="img_snow.jpg" alt="Snow" style="width:100%"></img>
            </div>
            <div class="column">
            <img src="img_forest.jpg" alt="Forest" style="width:100%"></img>
            </div>
            <div class="column">
            <img src="img_mountains.jpg" alt="Mountains" style="width:100%"></img>
            </div>
            </div>
        </div>
        

    )
}
export default Page2
